import React from "react";
import { NavLink } from "react-router-dom";

function Header() {
	return (
		<header>
			<NavLink to="/">
				<img src="https://cdn.shopify.com/s/files/1/1150/6518/files/Wordmark_Black_Web_360x_1_250x.png?v=1643609809" alt="Poly & Bark" />
			</NavLink>
		</header>
	)
}
export default Header;
